import AddUser from './components/Users/AddUser';
import UserData from './components/Users/UserData';


function App() {

  const [userEnteredData, setUserEnteredData ] = useState('');

  const enterdData = (data) => {
      // console.log(data);
      setUserEnteredData(data);
  }

  return (
    <div>
      <AddUser onSaveData={enterdData}/>
      <UserData userInputData={userEnteredData}/>
    </div>
  );
}

export default App;
